import React, { Component } from 'react'

export default class index extends Component {
    state = {
        b: [
            { id: 1, content: "雄关漫道真如铁" },
            { id: 2, content: "人间正道是沧桑" },
            { id: 3, content: "长风破浪会有时" }
        ]
    }
    render() {
        return (
            <div>
                <ul>
                    <li>1</li>
                    <li>2</li>
                    <li>3</li>

                </ul>
            </div>
        )
    }
}
